import React from 'react';

const HomePage = () => {
    return (
        <div>
            <h1>Welcome to the Fitness Tracker App</h1>
            <p>Track your workouts and stay motivated to reach your goals. 
                This app is designed to help you track your workouts and log your time for each exercise.
                You can also view your weekly stats to see how you are progressing towards your goals.
            </p>

            <h2>How to use this app</h2>
            <p>First, you will need to create an account or sign in if you already have an account.
                Once you are logged in, you can navigate to the Exercise page to log your workouts. 
                You can also navigate to the Profile page to view your profile information and update your goals.
                Finally, you can navigate to the Weekly Stats page to view your weekly stats.
            </p>
        </div>
    );
};

export default HomePage;
